import React from 'react';
import ticketList from './ticketList.json';

function Tickets () {
    let key;
    const tick = ticketList.tickets;

    return(
        <ul>
            {tick.map(item => (
                <li key={item[key]}>
                    {item.origin}
                    {item.origin_name}
                    {item.destination}
                    {item.destination_name}
                    {item.departure_date}
                    {item.departure_time}
                    {item.arrival_date}
                    {item.arrival_time}
                    {item.carrier}
                    {item.stops}
                    {item.price}
                </li>
            ))}
        </ul>
    )
}

export default Tickets;
